    public static class ModelBuilderSeedDataCreaterExtensions
    {
        public static void CreateSeedData(this ModelBuilder modelBuilder)
        {
            #region DummyData

            var dummyCategories = CreateDummyCategoryData();
            //Create Dummy data in db for Category tables
            modelBuilder.Entity<Category>().HasData(dummyCategories);

            var dummySliders = CreateDummySliderData();
            modelBuilder.Entity<Slider>().HasData(dummySliders);

            #region CreateProductsSeedData

            // Dummy Products
            var dummyProducts = GetDummyProducts();
            modelBuilder.Entity<Product>().HasData(dummyProducts);

            // Dummy ProductImages
            var dummyProductImages = GetDummyProductImages();
            modelBuilder.Entity<ProductImage>().HasData(dummyProductImages);

            // Dummy ProductComments
            var dummyProductComments = GetDummyProductComments();
            modelBuilder.Entity<ProductComment>().HasData(dummyProductComments);

            #endregion


            #endregion
        }


        private static List<Category> CreateDummyCategoryData()
        {
            List<Category> dummyCategories = new List<Category>();
            dummyCategories.Add(new Category()
            {
                CategoryId = 1,
                CategoryName = "Giyim",
                ParentCategoryId = null,
                Order = 1,
                Products = new List<Product>(),
                Image = "data:image/jpeg;base64,"

            }
            );

            dummyCategories.Add(new Category()
            {
                CategoryId = 2,
                CategoryName = "Elektronik",
                ParentCategoryId = null,
                Order = 2,
                Products = new List<Product>(),
                Image = "data:image/jpeg;base64,"
            }
            );
            dummyCategories.Add(new Category()
            {
                CategoryId = 3,
                CategoryName = "Ayakkabı",
                ParentCategoryId = null,
                Order = 3,
                Products = new List<Product>(),
                Image = "data:image/jpeg;base64,"
            }
            );

            dummyCategories.Add(new Category()
            {
                CategoryId = 4,
                CategoryName = "Market",
                ParentCategoryId = null,
                Order = 4,
                Products = new List<Product>(),
                Image = "data:image/jpeg;base64,"
            }
            );
            return dummyCategories;
        }

